import '../App.css';

function Map() {
  return (
    <div className="map">
        <h1 className="mapHeader">Our Solar System</h1>
        <h2 className="mapSubhead">The Solar System is pretty dang big, so it's hard to make it into a map. Just picture what's below in three-dimensions, </h2>
        <img src='https://www.visualcapitalist.com/wp-content/uploads/2020/02/solar-system-map-1200px.jpg' alt='solar system map'></img>
    </div>
  );
}

export default Map;
